import React, { Component } from 'react';


class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      term: '',
      items: []
    };
  }

  render () {
    return (
      <div>
        <form className="App">
        <input value={this.state.term} onChange={this.onChange} />
        <button>Submit</button>

        </form>
        Hi this todo list
      </div>
    );
  }

}

export default App;
